import Navbar from "./componentes/navbar/Navbar";
import Menu from "./componentes/menu/Menu";

import Inicio from "./paginas/inicio/inicio.jsx";

function App() {
	return (
		<div className="App">
			<Navbar />
			<div style={{ display: "flex" }} className="container">
				<Menu />
				<Inicio />
			</div>
		</div>
	);
}

export default App;
